import React from 'react';
import './nav.css';


const nav = ({toSignIn, toRegister}) => {
  return (
      <div className="App navigation">
        <button type='button' id='registerBtn' className='glassmorph' onClick={toRegister}>Register</button>
        <button type='button' id='signInBtn' className='glassmorph'>Sign-In</button>
      </div>
    );
}



export default nav;
